window.bookSummaryJSON = "<p><b>As Max and the team defeat yet another boss in the tower, they quickly realize that they are facing harder things than most.</b></p> <p>Each of them must work together to overcome challenges that test not only their strength and power but also their minds as new and dangerous puzzles begin to appear.</p> <p>Yet behind every rainbow and new opportunity that comes, someone is there trying to steal the freedom one gains.</p> <p>Their power is growing, and the realization of how strong they have become and the truth that there are still others even more so, they must work together to climb the tower and acquire the power needed to be safe from those who hunt Max.</p>"; 
